import React, { memo } from 'react';
import styled from 'styled-components';
import { List } from '@material-ui/core';
import { Skeleton } from '@material-ui/lab';
import LeaderboardTable from 'app/views/components/Test/LeaderboardTable';
import { StarBorderOutlined } from '@material-ui/icons';
import Theme from 'app/themes';
import LoadingIndicator from 'app/views/components/common/LoadingIndicator';

const Wrapper = styled.div`
	${props =>
		props.hasmargin === 'true' &&
		`	margin-top: 40px;
`}

	@media only screen and (min-width: 500px) and (max-width: 1280px) {
		padding: 0px 50px;
	}
`;

const TitleBox = styled.div`
	display: flex;
	align-items: center;
	color: ${Theme.ncpPrimaryDark};
	margin-bottom: 10px;
`;

const Title = styled.h4`
	font-size: 20px;
	font-weight: 700;
	margin-left: 15px;
	margin-bottom: 0px;
`;
const ContestantNameList = styled(List)``;

function Leaderboard(props) {
	const { leaderboardRes, hasTitle = true, hasMargin = true } = props;

	return (
		<Wrapper className="kt-portlet kt-portlet--height-fluid" hasmargin={hasMargin.toString()}>
			{hasTitle && (
				<div className="kt-portlet__head">
					<div className="kt-portlet__head-label">
						<StarBorderOutlined></StarBorderOutlined>
						<h3 className="kt-portlet__head-title">Leaderboard</h3>
					</div>
				</div>
			)}

			<div className="kt-portlet__body p-0">
				<ContestantNameList>
					<LeaderboardTable
						loading={leaderboardRes.loading}
						error={leaderboardRes.error}
						data={leaderboardRes.data}
					></LeaderboardTable>
				</ContestantNameList>
			</div>
		</Wrapper>
	);
}

export default memo(Leaderboard);
